import React from "react";
import UserContext from "../../utils/userContext"

//"../utils/userContext";

function Jumbotron({ children }) {
  return (

      <div
      style={{ height: 300, clear: "both", paddingTop: 120, textAlign: "center" }}
      className="jumbotron"
    >
      {children}

        <div>
        <h4>User Context Test</h4>

        </div>

    </div>

  );
}

export default Jumbotron;
